import React from 'react'

function ContactList(props){

    const Contacts = props.Contacts.map((contact) => {
        return (
            <div>
                <h1>{contact.name}</h1>
                <h3>{contact.email}</h3>
            </div>
        );
    }); 
    return (
        <div>

            <h3>Contacts</h3>
        </div>
    );
}
export default ContactList;
